import React, { Component } from 'react';
import { Table } from 'reactstrap';
import axios from 'axios';
import Buttons from './ButtonComponent';

class TableComponent extends Component {
    constructor(props) {
        super(props);
        this.state = {
            id: undefined,
            date: undefined,
            name: undefined,
            driver_id: undefined,
            driver_name: undefined
        };
        this.getData = this.getData.bind(this);
      }

    componentDidMount() {
        this.getData();
    }

    async getData () {
        const data = await axios.get ("http://localhost:8000/api/deliveries.php")
            .catch(error => {
                console.log(error);
            });
        let dataArr = await Object.values(data.data);
        // this.setState({
        //     id: data.data,
        //     date: data.data,
        //     name: data.data,
        //     driver_id: data.data
        // });
        console.log (dataArr[0].date);
    }

    render () {
        return (
            <div>
                <h1>Deliveries</h1>
                <Table className="table">
                    <thead>
                        <tr>
                            <th>#</th>
                            <th>Date</th>
                            <th>Name</th>
                            <th>Driver</th>
                            <th>&nbsp;</th>
                        </tr>
                    </thead>
                    <tbody>
                        <tr>
                            <th scope="row">123</th>
                            <td>123</td>
                            <td>123</td>
                            <td>123</td>
                            <Buttons getData = {this.getData}/>
                        </tr>
                    </tbody>
                </Table>
            </div>
        );
    }
}

export default TableComponent;
